import { Component } from '@angular/core';

declare function parseReplay(event: any): void;

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css'],
})
export class HomeComponent {
  files: any = null;
  uploadedFiles: any = null;

  constructor() {}

  onFilechange(event: any) {
    console.log(event.target.files);
    this.files = event.target.files;
  }

  upload() {
    parseReplay(this.files[0]);
  }
}
<div class="container">
  <div class="row mt-5">
    <div class="col-md-4">
      <div class="mb-3">
        <label for="formFile" class="form-label">
          Select your slippi directory
        </label>
        <input
          (change)="this.onFilechange($event)"
          class="form-control"
          type="file"
          id="formFile"
          multiple
          webkitdirectory
          directory
        />
        <button
          (click)="this.upload()"
          type="button"
          class="btn btn-primary mt-3"
        >
          Upload
        </button>
      </div>
    </div>
  </div>
</div>
